import React,{Component} from 'react';
import PostData from '../Coponent/PostData';
import Navibar from '../Coponent/Navibar';

class Signin extends Component {
    constructor(props){
        super(props)
        this.state = {
            username:"",
            password:""
        }
    }
    handleSubmit2= (event) =>{
        let url="http://127.0.0.1:8080/v2/user/login";
        const data=this.state;
        fetch(url,{
            method: 'post',
            headers:{
                'content-type':'application/json',
                'accept':'application/xml'
            },
            body: JSON.stringify(data)
        }).then((result) => {
            result.json().then((resp)=>{
                console.log(resp)
            })   
        })   
    }    
    handleInputChange = (event) =>{
        event.preventDefault()
        this.setState({
            [event.target.name] : event.target.value
        })
    }
    render(){
        const {username} =this.state
        const {password} =this.state
        return (
            <div className="back">
                <Navibar />
                <form onSubmit={this.handleSubmit2()}>
                    <div className="login">
                        <h1>Log in</h1>
                        <div className="textbox">
                            <i className="fa fa-envelope" aria-hidden="true"></i>
                            <input type="text" name="username" placeholder="email" value={username}
                            onChange={this.handleInputChange}/>
                        </div>
                        <div className="textbox">
                            <i className="fa fa-lock" aria-hidden="true"></i>
                            <input type="password" name="password" placeholder="password" value={password}
                            onChange={this.handleInputChange}/>
                        </div>
                        <button className="btn" onClick={()=> {this.handleSubmit2()}}>
                            Log in
                        </button>
                    </div>
            </form>

            </div>
        );
    }
}

export default Signin;
